package gcfv2.datastore_api;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import java.time.LocalDate;@NoArgsConstructor@Getter@Setterpublic class Ticket {    private String ticketId;    private String subject;    private String description;    private LocalDate creationDate;    private LocalDate updateDate;    public Ticket(String subject, String description, LocalDate creationDate, LocalDate updateDate) {        this.subject = subject;        this.description = description;        this.creationDate = creationDate;        this.updateDate = updateDate;    }}